//Input Styling
input[type="range"] {
  -webkit-appearance: none;
  margin: 0;
  width: 85%;
  background: $accent2;
  border-radius: 3px;
  height: 5px;
}
input[type="range"]:focus {
  outline: none;
}
input[type="range"]::-webkit-slider-runnable-track {
  width: 100%;
  height: 5px;
  cursor: pointer;
  background: $accent2;
  border-radius: 1.3px;
}
input[type="range"]::-webkit-slider-thumb {
  height: 9px;
  width: 18px;
  border-radius: 3px;
  background: $textcolor;
  cursor: pointer;
  -webkit-appearance: none;
  margin-top: -2px;
}
input[type="range"]:focus::-webkit-slider-runnable-track {
  background: $accent2;
}

input[type="range"]::-moz-range-track {
  width: 100%;
  height: 8.4px;
  cursor: pointer;
  background: $accent2;
  border-radius: 1.3px;
}
input[type="range"]::-moz-range-thumb {
  height: 9px;
  width: 18px;
  border-radius: 3px;
  background: $textcolor;
  cursor: pointer;
}

input[type="range"]::-ms-track {
  width: 100%;
  height: 5px;
  cursor: pointer;
  border-width: 16px 0;
}
input[type="range"]::-ms-fill-lower {
  background: $accent2;
  border-radius: 2.6px;
}
input[type="range"]::-ms-fill-upper {
  background: $accent2;
  border-radius: 2.6px;
}
input[type="range"]::-ms-thumb {
  height: 9px;
  width: 18px;
  border-radius: 3px;
  background: $textcolor;
  cursor: pointer;
}
input[type="range"]:focus::-ms-fill-lower {
  background: $accent2;
}
input[type="range"]:focus::-ms-fill-upper {
  background: $accent2;
}

